import React from 'react'

function Items(props) {
  const{_itemname,_getprice,_sellprice,_pices,_date } = props.item;
  return (
    <div>
      <h1>Item details</h1>
      <br/>
      <h1>itemname{_itemname}</h1>
      <h1>get price{_getprice}</h1>
      <h1>sellprice{_sellprice}</h1>
      <h1>pices{_pices}</h1>
      <h1>date{_date}</h1>
     


    </div>
  )
}

export default Items
